import React from "react";
import { useNavigate } from "react-router-dom";
import './Signup.css';

function Signup() {
    const navigate = useNavigate();
    
    const handleSignup = (event) => {
        event.preventDefault();
        // Perform signup logic here (e.g., validation, API call)
        navigate('/app');
    };

    return (
        <div className="signup-container">
            <div className="signup-header">
                Signup
            </div>
            <form onSubmit={handleSignup}>
                <div className="username-field">
                    <div className="label">
                        <h4>Email</h4>
                    </div>
                    <div className="input-field">
                        <input name="email" type="email" placeholder="Type your email" className="username" required />
                    </div>
                </div>
                <div className="password-field">
                    <div className="label">
                        <h4>Create Password</h4>
                    </div>
                    <div className="input-field">
                        <input className="password" name="password" type="password" placeholder="Type your Password " required />
                    </div>
                </div>
                <div className="password-field">
                    <div className="label">
                        <h4>Confirm Password</h4>
                    </div>
                    <div className="input-field">
                        <input className="password" name="confirm-password" type="password" placeholder="Confirm your Password " required />
                    </div>
                </div>
                <div className="signup-button">
                    <button type="submit">Signup</button>
                </div>
            </form>
        </div>
    );
}

export default Signup;
